const Popup=({display,setDisplay})=>{
    const style={
        height:display.height,
        width:display.width,
        display:display.display,
        position:'fixed',
        backgroundColor:display.backgroundColor,
        top:'50%',
        left:'auto',
        right:'auto',
        marginTop: '-25vh',
        marginLeft: '-25vw',
        zIndex:'10000',
        transition:display.transition,
        transform:display.transform,
    }
    return(
    <div style={style}>
        <button 
            onClick={()=>{
                setDisplay({...display,
                    height:'0vh',
                    width:'0vw',
                            })
                setTimeout(()=>{
                    setDisplay({...display,display:'none'})
                },500)
                                }}
        >取消</button>
        <button>確認新增</button>
    </div>
    )
}
export default Popup;
